description:
2 Albums from the band Asphyx, from 1991: The Rack/Cruch The Cenotaph.
It's the most awesome Dutch Death Metal!!!

This package includes:

*** The Rack ***
1) The Quest Of Absurdity;
2) Vermin;
3) Diabolical Existence;
4) Evocation;
5) Wasteland Of Terror;
6) The Sickening Dwell;
7) Ode To A Nameless Grave;
8) Pages In Blood;
9) The Rack.


*** Crush The Cenotaph ***
1) Crush The Cenotaph;
2) Rite Of Shades;
3) The Krusher;
4) Evocation (live);
5) Wasteland Of Terror (live).




Band members are:
- Martin Van Drunen (bass,vocals);
- Eric Daniels (guitar);
- Bob Bagchus (drums)
